import {combineReducers} from '@reduxjs/toolkit';
import * as counterReducer from './counter/counter.feature';
import * as employeeReducer from './employees/employees.feature';
import * as userReducer from './userList/userList.feature';

const rootReducer = combineReducers({
    [counterReducer.counterFeature]: counterReducer.counterSlice.reducer,
    [employeeReducer.employeeFeature]: employeeReducer.employeeSlice.reducer,
    [userReducer.userListFeature]: userReducer.userSlice.reducer
});

export default rootReducer;
